import React, { useState } from 'react';

export default function App() {
  const [formStep, setFormStep] = useState('email'); // 'email', 'checkout', 'error'
  const [email, setEmail] = useState('');
  const [selectedPlan, setSelectedPlan] = useState(null);
  const [error, setError] = useState('');

  const handleEmailSubmit = (e) => {
    e.preventDefault();
    if (!email) {
      setError('Please enter your email address');
      return;
    }
    setFormStep('checkout');
    setError('');
  };

  const handleCheckoutSubmit = (e) => {
    e.preventDefault();
    if (!selectedPlan) {
      setError('Please select a plan');
      return;
    }

    // Track conversion
    if (window.gtag_report_conversion) {
      window.gtag_report_conversion();
    }

    // Track form submission event
    if (window.gtag) {
      window.gtag('event', 'form_submission', {
        'event_category': 'engagement',
        'event_label': 'signup_form',
        'value': selectedPlan,
        'plan_type': selectedPlan,
        'email_domain': email.split('@')[1]
      });
    }

    // Show error state
    setFormStep('error');
  };

  const renderEmailStep = () => (
    <div className="mx-auto max-w-xl">
      <h2 className="text-2xl font-bold text-gray-900 mb-6">Start your 30-day free trial</h2>
      <form onSubmit={handleEmailSubmit}>
        <div className="mb-4">
          <label htmlFor="email" className="block text-sm font-semibold leading-6 text-gray-900">
            Your email address
          </label>
          <div className="mt-2.5">
            <input
              type="email"
              name="email"
              id="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              autoComplete="email"
              placeholder="luna@company.com"
              className="block w-full rounded-md border-0 px-3.5 py-2 text-gray-900 shadow-sm ring-1 ring-inset ring-gray-300 placeholder:text-gray-400 focus:ring-2 focus:ring-inset focus:ring-primary-600 sm:text-sm sm:leading-6"
            />
          </div>
        </div>
        {error && <p className="text-red-500 text-sm mb-4">{error}</p>}
        <button
          type="submit"
          className="w-full rounded-md bg-primary-600 px-3.5 py-2.5 text-sm font-semibold text-white shadow-sm hover:bg-primary-500 focus-visible:outline focus-visible:outline-2 focus-visible:outline-offset-2 focus-visible:outline-primary-600"
        >
          Continue to Checkout
        </button>
      </form>
    </div>
  );

  const renderCheckoutStep = () => (
    <div className="mx-auto max-w-xl">
      <h2 className="text-2xl font-bold text-gray-900 mb-6">Choose your plan</h2>
