        onClick={handleCheckoutSubmit}
        className="w-full mt-6 rounded-md bg-primary-600 px-3.5 py-2.5 text-sm font-semibold text-white shadow-sm hover:bg-primary-500 focus-visible:outline focus-visible:outline-2 focus-visible:outline-offset-2 focus-visible:outline-primary-600"
      >
        Start Trial
      </button>
    </div>
  );

  const renderErrorStep = () => (
    <div className="mx-auto max-w-xl text-center">
      <h2 className="text-2xl font-bold text-gray-900 mb-4">Uh oh, something went wrong</h2>
      <p className="text-gray-600 mb-6">We're having trouble processing your request. Please try again later.</p>
      <button
        onClick={() => setFormStep('email')}
        className="rounded-md bg-primary-600 px-3.5 py-2.5 text-sm font-semibold text-white shadow-sm hover:bg-primary-500 focus-visible:outline focus-visible:outline-2 focus-visible:outline-offset-2 focus-visible:outline-primary-600"
      >
        Try Again
      </button>
    </div>
  );

  return (
    <div className="bg-white min-h-screen">
      <header className="absolute inset-x-0 top-0 z-50">
        <nav className="flex items-center justify-center p-6 lg:px-8" aria-label="Global">
          <div className="flex">
            <a href="/" className="-m-1.5 p-1.5">
              <span className="text-2xl font-bold text-black">🏥 Medical Provider Leads</span>
            </a>
          </div>
        </nav>
      </header>

      <main className="relative isolate pt-32">
        {formStep === 'email' && renderEmailStep()}
        {formStep === 'checkout' && renderCheckoutStep()}
        {formStep === 'error' && renderErrorStep()}
      </main>
    </div>
  );
}

